import React from "react"
import "./SkillBar.css"

function getClassName(skill){
    return "skills_bar-" + skill.toLowerCase()
}

function SkillBar(props){
    mySkillBar = getClassName(props.skill)
    return(
        <div className="skill">
            <div className="skills__tag-html">
                <p>{props.skill}</p>
            </div>
            <div className="skills__progressbar">
                <div className={mySkillBar}></div>
            </div>
        </div>
    )
}

export default SkillBar
